import React, {useEffect, useState} from "react";
import { fetchPosts } from "../api/api";
import PostsItem from "./PostsItem"


const Posts = ({posts}) => {
    console.log(posts)
    return (<div>
        {posts.map((post) => {
            return <PostsItem key={post._id}/>
        })}
    </div>
    );
};

export default Posts;
